import React from "react";

const OrderSummary = (props) => {
  return (
    <div>
      <h3>Your order</h3>
      <p>Your Burger</p>
      <ul>
        (props.ingredient).map((el) => (<li>{el} : 1</li>
        ))}
      </ul>
    </div>
  );
};

export default OrderSummary;
